    override fun onUpgrade(db: SQLiteDatabase, oldVersion: Int, newVersion: Int){
        db.execSQL("DROP TABLE IF EXISTS beer_categories")
        db.execSQL("DROP TABLE IF EXISTS user")
        onCreate(db)
    }

    fun getAllBeerCategories(): HashMap<String, String>{
        val beerCategories = HashMap<String, String>()
        val cursor = readableDatabase.query(
            "beer_categories",
            null,
            null,
            null,
            null,
            null,
            "id DESC"
        )
        while(cursor.moveToNext()){
            val beerId: String = cursor.getString(BEER_ID_COLUMN_INDEX)
            val beerCategory: String = cursor.getString(BEER_STYLE_COLUMN_INDEX)
            beerCategories[beerId] = beerCategory
        }
        cursor.close()
        return beerCategories
    }

    fun getBeerHexCode(hashedBeerName: String): Any {
        val cursor = readableDatabase.query(
            "beer_categories",
            null,
            null,
            null,
            null,
            null,
            "id DESC"
        )
        while(cursor.moveToNext()){
            val beerId: String = cursor.getString(BEER_ID_COLUMN_INDEX)
            val beerHexCodes: String = cursor.getString(BEER_HEX_CODES_COLUMN_INDEX)
            val hexCodes: List<String> = beerHexCodes.split("|")
            if(hexCodes.contains(hashedBeerName)){
                cursor.close()
                return Pair<String, String>(beerId, hashedBeerName)
            }
        }
        cursor.close()
        return Unit
    }


